import store from "./store"


export const createAddAction = (data)=>{
    return {type:'increase',data}
}
export const createDecreaseAction = (data)=>{
    return {type:'decrease',data}
}
export const creastanyscAction = (data,time) =>{
    return (dispatch)=>{
        setTimeout(() => {
            dispatch(createAddAction(data))
          }, time)
    }
}
